import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { PreguntasComponent } from './preguntas/preguntas.component';
import { ResultadoComponent } from './resultado/resultado.component';
import { NewsletterVentanaComponent } from '../shared/newsletter/newsletter-ventana/newsletter-ventana.component';


@NgModule({
  declarations: [
    PreguntasComponent,
    ResultadoComponent
  ],
  imports: [
    CommonModule,
    NewsletterVentanaComponent
  ],
  exports: [
    PreguntasComponent,
    ResultadoComponent
  ]
})
export class AptoSangreModule { }
